import React from 'react';
import { Link } from 'react-router-dom';
import Img from '../images/Work-Simply Logo Design-Jpg.jpg'; // Importing the image

const NavBar = () => {
  return (
    <div>
      <section class="py-5">
        <nav class="navbar navbar-expand-md bg-light fixed-top">
          <div class="container">
            <a class="navbar-brand" href=""><img alt="Free Frontend Logo" class="img-fluid" height="" src={Img} width="300" /></a> <button aria-controls="navbarSupportedContent2" aria-expanded="false" aria-label="Toggle navigation" class="navbar-toggler" data-bs-target="#navbarSupportedContent2" data-bs-toggle="collapse" type="button"><span class="navbar-toggler-icon"></span></button>
            <div class="collapse navbar-collapse" id="navbarSupportedContent2">
              <ul class="navbar-nav ms-auto my-2 my-md-0">
               
                <li className="nav-item  ms-md-4">
                  <Link class="nav-link" to="/about" className="nav-link">About</Link>
                </li>
                <li className="nav-item  ms-md-4">
                  <Link class="nav-link" to="/contact" className="nav-link">Contact</Link>
                </li>

              
              </ul>
            </div>
          </div>
        </nav>
      </section>
    
    </div>
  );
};

export default NavBar;
